import React from 'react'
import './login.css'
import logo from '../images/image.png';

function Login() {
  return (
    <div className='loginContainer'>
        <div className='header'>
            <img src={logo} alt='reachinbox logo' />
        </div>
        <div className=''>

        </div>
        <div></div>
    </div>
  )
}

export default Login
